import React from 'react';
import './App.css';
import { makeStyles} from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import HomeIcon from '@material-ui/icons/Home';
import FormatListNumberedIcon from '@material-ui/icons/FormatListNumbered';
import TrendingUpIcon from '@material-ui/icons/TrendingUp';
import SettingsIcon from '@material-ui/icons/Settings';
import Car from './components/Header.js';

import { BrowserRouter as Router, Link} from 'react-router-dom';

const useStyles = makeStyles((theme) => {

})


function App() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  return (
    <div className="App">
      <Car />

      <Router>
        <footer>
        <BottomNavigation
          value={value}
          onChange={(event, newValue) => {
            setValue(newValue);
          }}
          showLabels
          className='bottomnav'
        >
          <Link to="/about"><BottomNavigationAction label="Home" icon={<HomeIcon />} /></Link>
          <BottomNavigationAction label="Me" icon={<FormatListNumberedIcon />} />
          <BottomNavigationAction label="Progress" icon={<TrendingUpIcon />} />
          <BottomNavigationAction label="Settings" icon={<SettingsIcon />} />
        </BottomNavigation>
        </footer>
      </Router>


    </div>
  );
}

export default App;
